import React, { useState } from "react";
// ... other imports ...

const code = new URLSearchParams(window.location.search).get("code");

function App() {
  const [selectedTimeRange, setSelectedTimeRange] = useState(null); // Initialize the state here

  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/dashboard" element={code ? <Dashboard code={code} selectedTimeRange={selectedTimeRange} setSelectedTimeRange={setSelectedTimeRange} /> : <Navigate to="/" />} />
          <Route path="/" element={!code ? <><Login /><Settings /></> : <Navigate to="/dashboard" />} />
          <Route path="/dashboard/Tracks" element={<Tracks code={code} selectedTimeRange={selectedTimeRange} setSelectedTimeRange={setSelectedTimeRange} />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
}

export default App;
